@Test
    public void fusionRejected() {
        TestSubscriber<Integer> ts = SubscriberFusion.newTest(QueueFuseable.ASYNC);

        Flowable.fromIterable(Arrays.asList(1, 2, 3))
        .subscribe(ts);

        SubscriberFusion.assertFusion(ts, QueueFuseable.NONE)
        .assertResult(1, 2, 3);
    }

